import './App.css';
import "bootstrap/dist/css/bootstrap.min.css";
import {BrowserRouter, Routes, Route} from 'react-router-dom';
import Auth from './auth/Auth';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Routes>
        <Route path='/' element={<Auth />}></Route>
      </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
